import React from 'react';
import {Link} from 'react-router-dom';
// import './ProductsCard.css'
//_id":"5d5e744a84715c4a1c47e3e4","brend":"Samsung","model":"M10","category":"Notebook","description":"Екран 6.3","cost":6000,"createdAt":"1566545124678
const ProductsCard = (product) =>

<Link to="/product/${product._id}">
    {/*<p className="products-card__brend">{product.brend}</p>*/}
    {/*<p className="products-card__model">{product.model}</p>*/}
    {/*<div className="products-card__stats">*/}
        <div>
            <p>{product.description}</p>
            <span>Description</span>
        </div>
        <div>
            <p>{product.cost}</p>
            <span>Price</span>
        </div>
        <div>
            <p>{product.category}</p>
            <span>Category</span>
        </div>
    {/*</div>*/}
</Link>;
export default ProductsCard;
